		var ba = buf_array();
		write_record(ba, 0x0116 /* BrtBeginStyleSheet */);
		write_FMTS_bin(ba, wb.SSF);
		write_FONTS_bin(ba);
		write_FILLS_bin(ba);
		write_BORDERS_bin(ba);
		write_CELLSTYLEXFS_bin(ba);
		write_CELLXFS_bin(ba, opts.cellXfs);
